	function _toJson(value) {
		if (value == undefined || value == null)
			return value
		switch (typeof(value)) {
			case "number":
			case "string":
			case "boolean":
				return value.toString()
			default:
				return JSON.stringify(value)
		}
	}

	function _lazyPeopleHttpFlatten(map) {
		const array = []
		Object.entries(map).forEach((entrie) => {
			array.push(entrie[0]);
			array.push(entrie[1])
		})
		return array
	}
}

